import React from 'react';
import './css/AboutMe.css';

class AboutMe extends React.Component {
  render () {
    return (
      <div className="about-me-background">
        <div className="about-me-container">

          <h1 className="about-me-header">About Me</h1>
          <div className="about-me-row">
            <div className="about-me-col">
              <p className="about-me-1">Driven and open minded, I am software developer from Victoria, BC, Canada, that strives to build innovative solutions using my creative, communication, and procedural skills.</p>
            </div>
